import { Container } from "react-bootstrap";

const MyFooter = () => {
  return (
    <Container>
      <div className="mt-auto">
        <div className="text-center">
          <p>This will be dynamic text</p>
        </div>
      </div>
    </Container>
  );
};
export default MyFooter;
